import React, {Component} from 'react'
import ScrollButton from 'react-scroll-button'

class ScrollComponent extends Component {
        render() {
            return (
                <ScrollButton 
                    targetId={'homepage'}
                    behavior={'smooth'} 
                    buttonBackgroundColor={'orange'}
                    buttonColor={'white'}
                    iconType={'arrow-up'}
                    style= {{fontSize: '24px'}}
                />
        );
    }
}

export default ScrollComponent;
